import React from "react";
import styled from "styled-components";

const Box = styled.div`
    width: 400px;
    min-width: 400px;
    height: 220px;
    background-color: #999;
    background-image: url("https://i.pinimg.com/474x/17/12/c9/1712c9ec77f883ee3f7d703e4d8f997f.jpg");
    margin: 40px;

    border-radius: 7px;
    box-shadow: 2px 2px 4px #999;

    padding: 5px;

    display: flex;
    flex-direction: row;
`;

const PosterDiv = styled.div`
    width: 120px;
    height: 100%;
`;

const ContentDiv = styled.div`
    width: calc(100% - 200px);
    height: 100%;
`;

const MovieBox = () => {
    return (
        <Box>
            <PosterDiv></PosterDiv>
            <ContentDiv></ContentDiv>
        </Box>
    )
};

export default MovieBox;
